# Convert the original dict format in a database
# Data from file Crudes.mdb from Chemcad folder

# Crude reference
"""
    0 nombre del crudo
    1 origen
    2 fecha
    3 API
    4 SULFUR           wt.%
    5 MSULFUR          ? Mercaptan sulfur, ppm
    6 NITROGEN
    7 POURPOINT
    8 VISC70F
    9 VISC100F
    10 VANADIUM         ppm
    11 NICKEL               ppm
    12 CONC               ?     Conradson carbon residuo
    13 ASPH                ?    asphaltenes?
    14 NPENTANE        ?
    15 REIDVP
    16 FLASHPOINT
    17 HSULFIDE
    18 NNMGKOH, neutr. no. mg KOH/g
    19 BOTTWATER
    20 ASHCONT          ?  cenizas?
    21 SALT                 ?unit lb/1000barrel_US
    22 C1LV        %vol
    23 C2LV
    24 C3LV
    25 IC4LV
    26 NC4LV
    27 IC5LV
    28 NC5LV
    29 Indice
"""

connection = sqlite3.connect('dat/databank.db')
cursor = connection.cursor()
cursor.execute("""CREATE TABLE IF NOT EXISTS CrudeOil \
               (id INTEGER PRIMARY KEY,
               name TEXT,
               location TEXT,
               date INTEGER,
               API FLOAT,
               sulfur FLOAT,
               msulfur FLOAT,
               nitrogen FLOAT,
               pourP FLOAT,
               v70 FLOAT,
               v100 FLOAT,
               vanadium FLOAT,
               nickel FLOAT,
               conc FLOAT,
               asph FLOAT,
               npentane FLOAT,
               reidvp FLOAT,
               flashP FLOAT,
               hsulfide FLOAT,
               nmgKOH FLOAT,
               bottwater FLOAT,
               ash FLOAT,
               salt FLOAT,
               C1 FLOAT,
               C2 FLOAT,
               C3 FLOAT,
               iC4 FLOAT,
               nC4 FLOAT,
               iC5 FLOAT,
               nC5 FLOAT)""")

for crude in crudo:
        cursor.execute(
            """insert into CrudeOil (name, location, date, API, sulfur, msulfur,
            nitrogen, pourP, v70, v100, vanadium, nickel, conc, asph, npentane,
            reidvp, flashP, hsulfide, nmgKOH, bottwater, ash, salt, C1, C2, C3,
            iC4, nC4, iC5, nC5) values
            (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?,
            ?, ?, ?, ?, ?, ?, ?)""", (crude[:-1]))

connection.commit()


